Test Case 1: Bridge Request Emission This test case ensures that a bridge request emits the correct events when created. function testBridgeRequestEmitEvents() public returns (Structs.BridgeRequestData memory) { vm.startPrank(bob); IERC20(usdc).approve(address(localVault), 1000 * 10**6); vm.expectEmit(true, true, true, true); emit Events.BridgeRequest(bob, usdc, 0, 1000 * 10**6, 1000 * 10**6, address(remote Vault), alice, 0); localVault.bridge{value: bridgeFee}(usdc, 1000 * 10**6, 1000 * 10**6, address(remoteVault), alice); vm.stopPrank(); return Structs.BridgeRequestData( bob, usdc, 1000 * 10**6, 1000 * 10**6, address(remoteVault), alice, 0 );
} Test Case 2: Operator Attestation Submission This test case verifies that an operator can submit an attestation for a bridge request. function testOperatorCanSubmitAttestation() public { testBridgeRequestEmitEvents(); ( address user, address tokenAddress, uint256 amountIn, uint256 amountOut, address destinationVault, address destinationAddress, uint256 transferIndex ) = localVault.bridgeRequests(0); Structs.BridgeRequestData memory bridgeRequest = Structs.BridgeRequestData( user, tokenAddress, amountIn, amountOut, destinationVault, destinationAddress, transferIndex ); bytes memory attestation = signBridgeRequestData(localVault, bridgeRequest, operatorPrivateKey); vm.prank(operator); vm.expectEmit(true, true, true, true); emit Events.AVSAttestation(attestation, 0, 1000 ether); localVault.publishAttestation(attestation, 0);
} Test Case 3: Fund Release Completion This test case ensures that the bridge completes and releases funds correctly. function testBridgeCompletesReleaseFunds() public { testBridgeRequestEmitEvents(); ( address user, address tokenAddress, uint256 amountIn, uint256 amountOut, address destinationVault, address destinationAddress, uint256 transferIndex ) = localVault.bridgeRequests(0); Structs.BridgeRequestData memory bridgeRequest = Structs.BridgeRequestData( user, tokenAddress, amountIn, amountOut, destinationVault, destinationAddress, transferIndex ); bytes memory attestation = signBridgeRequestData(remoteVault, bridgeRequest, operatorPrivateKey); bytes[] memory bridgeRequestSignatures = new bytes[](1); bridgeRequestSignatures[0] = attestation; assertEq(IERC20(usdc).balanceOf(address(remoteVault)), 1000 * 10**6); assertEq(IERC20(usdc).balanceOf(alice), 0); vm.prank(alice); remoteVault.releaseFunds(bridgeRequestSignatures, bridgeRequest); assertEq(IERC20(usdc).balanceOf(address(remoteVault)), 0); assertEq(IERC20(usdc).balanceOf(alice), 1000 * 10**6);
}
